import React, { useEffect, useState } from 'react';
import axios from 'axios';


const FormUpdate = ({selectedEntry, setSelectedEntry, refreshList}) => {
    const url = "http://localhost:8000/api/entries/"
    //adding state to the functional component through useState React Hook
    const [entries, setEntries] = useState({ 
        id: 0,
        name: '',
        email: '',
        select: '',
        shirtOption: '',
        raceOption: '',
        comments: '',
    });

    useEffect(() => {
        if(selectedEntry) {
            setEntries({
                id: selectedEntry.id,
                name: selectedEntry.name,
                email: selectedEntry.email,
                select: selectedEntry.select,
                raceOption: selectedEntry.raceOption,
                comments: selectedEntry.comments
            })
        }
    }, [selectedEntry]);
    
    const handleCancel = () => {
        setSelectedEntry(null);
    };

    const handleChange = (e) => {
        setEntries({ ...entries, [e.target.name]: e.target.value });
    };
    

    //creating the onSubmit function to submit the form to the backend
    const handleSubmit = (e) => {
            //using axios to call to the backend to create or post a new entry
            e.preventDefault();
            axios.post(url, entries) 
                .then((response) => {
                    //logging the data to the console 
                    console.log(response.data); 
                    refreshList();
                    alert('Form submitted successfully');
                })
                .catch((error) => {
                    console.error(error);
                    alert('An error occurred. Please try again.')
                });
        
    };


    return(
        <form className='form' onSubmit={handleSubmit}>
            <div className='formField'>
                <label className='label'>Name: </label>
                <input className='input' type='text'value={entries.name} onChange={handleChange} ></input>
                
            </div>
            <div className='formField'>
                <label className='label'>Email: </label>
                <input className='input'type='text' value={entries.email} onChange={handleChange}></input>
                
            </div>
            <div className='formField'>
                <label className='label'>Select: </label>
                <select value={entries.select} name="select" onChange={handleChange}>
                    <option value=''>Do you want your name on your bib?</option>
                    <option value='Yes'>Yes</option>
                    <option value='No'>No</option>
                </select>
                
            </div>
            <div className='formField'>
            <label className='label'>Choose a Race: </label>
                <label >
                    <input
                        type="radio"
                        onChange={handleChange}
                        name="raceOption"
                        value="5k"
                        checked={entries.raceOption === "5k"}
                        
                    />
                    5k
                </label>
                <label >
                    <input
                        type="radio"
                        onChange={handleChange}
                        name="raceOption"
                        value="Half-Marathon"
                        checked={entries.raceOption === "Half-Marathon"}

                    />
                    Half-Marathon
                </label>
                <label >
                    <input
                        type="radio"
                        onChange={handleChange}
                        name="raceOption"
                        value="Marathon"
                        checked={entries.raceOption === "Marathon"}
                    />
                    Marathon
                </label>
                
            </div>
            <div className='formField'>
                <label className='label'>Comments: </label>
                <textarea className='text-area' name="comments" type='text' value={formData.comments} onChange={handleChange}></textarea>
                
            </div>
            <button className='submitButton' type='submit'>Submit</button>
            <button onClick={handleCancel}>Cancel</button>
        </form>
    )

}

export default FormUpdate;
